package cn.udesk.model;import udesk.core.model.MessageInfo;//排队时的消息public class UdeskQueueItem extends MessageInfo {    private boolean enableLeaveMsg;    private String queueContent;    public UdeskQueueItem() {    }    public UdeskQueueItem(boolean enableLeaveMsg, String queueContent) {        this.enableLeaveMsg = enableLeaveMsg;        this.queueContent = queueContent;    }    public boolean isEnableLeaveMsg() {        return enableLeaveMsg;    }    public void setEnableLeaveMsg(boolean enableLeaveMsg) {        this.enableLeaveMsg = enableLeaveMsg;    }    public String getQueueContent() {        return queueContent;    }    public void setQueueContent(String queueContent) {        this.queueContent = queueContent;    }}